  return (
    <table>
      <thead>
        <tr>
          {head.map(h, key =>(
            <th>{h}</th>
          ))}
        </tr>
      </thead>
      <tbody>
        <tr>
          <td>item 1</td>
          <td>item 2</td>
          <td>item 3</td>
        </tr>
      </tbody>
    </table>
  );
}
